import React from 'react';
// import CaseImages from '.../CaseImages';

export default function CaseStudyCard(props) {
    return (
        <div>
        <div className="px-10 flex flex-col items-center">
            <img className="rounded-sm pb-2" src={props.image} alt={props.alt}/>
        </div>
        <h3 className="space-y-4 pl-32 text-white font-usual">{props.header}</h3>
        </div>
        )
};
